import React, { useState } from "react";
import './Navbar.css';
import { Link } from 'react-router-dom';
import Index from "../";

export default function Navbar() {
    return (
        <>
            <div className="navbar-container">
                <Link to="/">Home</Link>
                <Link to="/who-we-are">Chi siamo</Link>
                <Link to="/contact-us">Contattaci</Link>
            </div>
        </>
    );
}
